import websiteLogo from '../resources/CookieDoughLogo.svg';
import cartIcon from '../resources/cart.svg';
import profileIcon from '../resources/profile.svg';
import IconButton from '../Components/IconButton/IconButton'
import SearchForm from './SearchForm/SearchForm';
import './Header.css';

function Header(){
    return(
    <div className= 'header-bar'>
        <div className= 'div-right'>
            <IconButton>
                <img src= {websiteLogo} className= 'website-logo' alt='Cookie Dough Logo'></img>
            </IconButton>
        </div>
        <div className= 'div-center'>
            <SearchForm/>
        </div>
        <div className= 'div-left'>
            <nav>
                <IconButton>
                    <img src= {cartIcon} className= 'header-icon' alt= 'Cart'></img>
                </IconButton>
                <IconButton>
                    <img src= {profileIcon} className= 'header-icon' alt= 'profile'></img>
                </IconButton>
            </nav>
        </div>
    </div>)
}

export default Header;
